import React from 'react';

function ServiciosList({ servicios }) {
  return (
    <div>
      <h2>Servicios Disponibles</h2>
      <ul>
        {servicios.map(servicio => (
          <li key={servicio.id}>{servicio.nombre}</li>
        ))}
      </ul>
    </div>
  );
}

export default ServiciosList;
